import React, { useState } from 'react';
import './Login.css';
import { Link, NavLink  } from "react-router-dom";

const Signup = () => { 
  const password = document.getElementById("password");
  const confirm_password = document.getElementById("confirm_password");

  function validatePassword() {
    if (password.value !== confirm_password.value) {
      confirm_password.setCustomValidity("Passwords Don't Match");
    } else {
      confirm_password.setCustomValidity('');
    }
  }

  password.onchange = validatePassword;
  confirm_password.onkeyup = validatePassword;

  const showHidePassword = () => {
    if (password.type === 'password') {
      password.setAttribute('type', 'text');
      toggler.classList.add('fa-eye-slash');
    } else {
      toggler.classList.remove('fa-eye-slash');
      password.setAttribute('type', 'password');
    }
  };

  const toggler = document.getElementById('toggler');
  toggler.addEventListener('click', showHidePassword);

  const onlyNumberKey = evt => {
    // Only ASCII character in that range allowed
    const ASCIICode = evt.which ? evt.which : evt.keyCode;
    if (ASCIICode > 31 && (ASCIICode < 48 || ASCIICode > 57)) {
      return false;
    }
    return true;
  };
  return (
<> 
  <meta charSet="UTF-8" />
  <title>Sign up Page</title>
  <link
    href="https://fonts.googleapis.com/css?family=Open+Sans"
    rel="stylesheet"
  />
  <link
    href="https://maxcdn.bootstrapcdn.com/font-awesome/4.7.0/css/font-awesome.min.css"
    rel="stylesheet"
    integrity="sha384-wvfXpqpZZVQGK6TAh5PVlGOfQNHSoD2xbE+QkPxCAFlNEevoEH3Sl0sibVcOQVnN"
    crossOrigin="anonymous"
  />
  <link rel="stylesheet" href="./style.css" />
  <meta name="viewport" content="device-width, initial-scale=1.0" />
  <link
    rel="stylesheet"
    href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0-beta3/css/all.min.css"
    integrity="sha512-Fo3rlrZj/k7ujTnHg4CGR2D7kSs0v4LLanw2qksYuRlEzO+tcaEPQogQ0KaoGN26/zrn20ImR1DfuLWnOo7aBA=="
    crossOrigin="anonymous"
    referrerPolicy="no-referrer"
  />
  <div className="container">
    <h5>Sign Up</h5>
    <form action="">
      <input type="text" placeholder="Enter your full name" required="" />
      <br />
      <input
        type="password"
        placeholder="Enter your password"
        name="psw"
        id="password"
        required=""
      />
      <span>
        <i id="toggler" className="far fa-eye" />
      </span>
      <br />
      <input
        type="password"
        placeholder="Repeat Password"
        name="psw-repeat"
        id="confirm_password"
        required=""
      />
      <input type="email" placeholder="Email Address" required="" />
      <input
        type="tel"
        onkeypress="return onlyNumberKey(event)"
        placeholder="Mobile Number"
        required=""
      />
      <input type="text" placeholder="Enter your address" required="" />
      <br /> <br />
      <div>
        <label htmlFor="Gender" className="Glabel">
          Gender:
        </label>
        <select name="Gender" id="Gender" className="selection" required="">
          <option value="">--</option>
          <option value="male">Male</option>
          <option value="female">Female</option>
        </select>
        <br />
        <br />
      </div>
      <div>
        <label htmlFor="Blood Group" className="label">
          Blood Group:
        </label>
        <select
          name="Blood Group"
          id="Blood Group"
          className="selection"
          required=""
        >
          <option value="">please select</option>
          <option value="A+">A+</option>
          <option value="A-">A-</option>
          <option value="B+">B+</option>
          <option value="B-">B-</option>
          <option value="O+">O+</option>
          <option value="O-">O-</option>
          <option value="AB+">AB+</option>
          <option value="AB-">AB-</option>
        </select>
        <br />
      </div>
      <div>
        <input type="checkbox" className="check_box" required="" />
        <p>
          Before sign up check the{" "}
          <a href="donate/index.html">eligibility to donate</a>
        </p>
      </div>
      <input type="submit" defaultValue="Register" className="button" />
    </form>
  </div>
</>



  
  );
};

export default Signup;
